class Tabler extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            data_table: [
                <tr>
                    <td>
                        test on state
                    </td>
                    <td>
                        <center><div class="circle2"></div></center>
                    </td>
                    <td>
                        HLT500_V306701
                    </td>
                    <td>
                        <input type={'text'} name='EMEI' defaultValue="HLT500_V306703"></input>
                    </td>
                    <td>
                        <Button class="btn btn-primary btn-sm" color="primary" >
                            UPDATE
                        </Button>
                    </td>
                </tr>
            ]
        }
    }
    create_circle(x){
        if (x == 1){
            return (<center><div class="circle2"></div></center>)
        }
        else{            
            return (<center><div class="circle1"></div></center>)
        }
    }
    create_input(value ){
        return (<input type={'text'} name='EMEI' defaultValue={value}></input>)
    }
    create_row_of_table(a) {
        return <tr>
            <td>
                {a['imei']}
            </td>
            <td>
                {this.create_circle(a['mod'])}
            </td>
            <td>
                {a['fw']}
            </td>
            <td>
                {this.create_input(a['config'])}
            </td>
            <td>
                <Button class="btn btn-primary btn-sm" color="primary" >
                    UPDATE
                </Button>
            </td>
        </tr>
    }
    render() {
        return (
            <Table responsive size="small">
                <thead bgcolor="#212529">
                    <tr>
                        <th>IMEI</th>
                        <th>CHECK</th>
                        <th>FVC</th>
                        <th>FVU</th>
                        <th>CONFIG</th>
                    </tr>
                </thead>
                <tbody bgcolor="#FFFFFF">
                    {this.create_row_of_table()}
                </tbody>
            </Table>
        );
    }
}

export default Tabler;
